import axios from 'axios'

const Corona = () => {

   useEffect(() => {
       async function getData()
       {
           const res = axios.get(`https://api.covid19api.com/summary`)
           document.write(res);
       }
   })

    return <h1>Welcome to see Corona Data</h1>
}

export default Corona
